window.bookSummaryJSON = "<p>Garden gnomes have lived rent-free long enough.</p> <p>The last thing necromancer Damian Vesik expects to face is a clan of panicky garden gnomes. But his sister, Sam, gave her word to protect them, and breaking her word to the Fae would be disastrous.</p> <p>With help from Calbach, the iron-touched Fae, they seek what is stalking the garden gnomes. Reality proves far worse than they imagined, landing Damian and his friends on the wrong side of the Iron Queen's most-feared assassin.</p> <p>The queen may be the key to defeating the dreaded red cap, but the garden gnomes’ ancient betrayal of their queen created bad blood between them. As the threat from the red cap looms, Damian, Foster, and Calbach must take Nog deep into Faerie in an attempt to right an old wrong.</p> <p>Gritty action meets snarky humor in this stand-alone entry in the Vesik<i> </i>series!</p>"; 
